export const Navigation = () => {
    return (
        <div>
            <nav style={{display: 'flex', justifyContent: 'flex'}}>
                <p className="f3 link dim black pa3 pointer">Sign out</p>
            </nav>
        </div>
                
    )
}

export default Navigation;
